    In most cases, the best default is \'%s\'. You can also select \'%s\' to preserve the old behavior, or some other remote or branch. But you almost certainly want to select \'origin/master\'.
    (Technically: the merge-base of the selected revision and HEAD is used to determine the start of the commit range.)' => 'Вы запускаете команду, которая работает с диапазоном ревизий (обычно от некоторой ревизии до HEAD), но не указала ревизию, которая должна определять начало диапазона.
